            |>Html_node.from_text
            |>parse_single_main_twitter_post   
        
        post
        |>Main_post.audio_space
        |>function
        |Some space ->
            space.title
            |>should equal "late night e/acc space"
            space.host
            |>should equal "Beff Jezos — e/acc ⏩"
            space.audience_amount
            |>should equal 2700
        |None->raise (Bad_post_exception("no audio space in the main post"))
        
        post
        |>Main_post.external_source
        |>function
        |Some (Quoted_message quotation) ->
            
            quotation.audio_space
            |>should equal None
            
            quotation.media_load
            |>should equal [
                Media_item.Image {
                    url="https://pbs.twimg.com/media/F61myJuWkAArDgv?format=webp&name=tiny"
                    description = "Image" 
                }
                Media_item.Image {
                    url="https://pbs.twimg.com/media/F61mz2MWsAAN5CY?format=webp&name=tiny"
                    description = "Image" 
                }
            ]
            
        |wrong_source -> raise (Bad_post_exception($"this post should contain a quotation but here's {wrong_source}"))       
        

